import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import "../styles/report.css";

export default function Report(){
  const { state } = useLocation();
  const { analysis, transcript } = state || {};

  if(!analysis) return <h2 style={{padding:40}}>No report found</h2>;

  return (
    <div className="report-page">

      {/* HEADER */}
      <div className="report-header">
        <h2>ðŸ¤– AI Interview Report</h2>
        <p>Date: {new Date().toDateString()}</p>
      </div>

      <div className="report-body">

        {/* LEFT */}
        <div className="report-left">

          <div className="score-card">
            <Score title="Confidence" value={analysis.confidence_score}/>
            <Score title="Pace" value={analysis.pace_score}/>
            <Score title="Engagement" value={analysis.engagement_score}/>
          </div>

          <div className="transcript-box">
            <h3>Transcript</h3>
            <p>{transcript || "Transcript not available"}</p>
          </div>

          <button className="download-btn">Download Report</button>

        </div>

        {/* RIGHT */}
        <div className="report-right">
          <h3>AI Feedback</h3>
          {analysis.ai_feedback?.map((f,i)=>(
            <div key={i} className="feedback-card">ðŸ’¡ {f}</div>
          ))}
        </div>

      </div>
    </div>
  );
}

/* ===========================
   â­ Animated Score Component
=========================== */
function Score({ title, value }){
  const [animated, setAnimated] = useState(0);

  // Animation fill
  useEffect(()=>{
    let i = 0;
    const interval = setInterval(()=>{
      i++;
      setAnimated(i);
      if(i>=value) clearInterval(interval);
    },60);
    return ()=>clearInterval(interval);
  },[value]);

  const percent = animated * 10;

  // Auto color logic
  let color = "#ef4444"; // red
  if(value>=7) color="#10b981"; // green
  else if(value>=5) color="#f59e0b"; // yellow

  return (
    <div
      className="score"
      style={{
        transition:"0.3s",
        boxShadow:"0 4px 12px rgba(0,0,0,0.05)"
      }}
      onMouseEnter={(e)=>{
        e.currentTarget.style.transform="translateY(-6px)";
        e.currentTarget.style.boxShadow="0 12px 25px rgba(0,0,0,0.15)";
      }}
      onMouseLeave={(e)=>{
        e.currentTarget.style.transform="none";
        e.currentTarget.style.boxShadow="0 4px 12px rgba(0,0,0,0.05)";
      }}
    >
      <h4>{title}</h4>

      {/* Circle */}
      <div
        style={{
          width:120,
          height:120,
          margin:"auto",
          borderRadius:"50%",
          display:"flex",
          alignItems:"center",
          justifyContent:"center",
          background:`conic-gradient(${color} ${percent}%, #e5e7eb 0)`,
          transition:"1s",
          boxShadow:`0 0 15px ${color}40`
        }}
      >
        <div
          style={{
            width:85,
            height:85,
            borderRadius:"50%",
            background:"#fff",
            display:"flex",
            alignItems:"center",
            justifyContent:"center",
            fontWeight:700,
            fontSize:22
          }}
        >
          {animated}/10
        </div>
      </div>

      {/* Progress bar */}
      <div
        style={{
          height:8,
          background:"#e5e7eb",
          borderRadius:10,
          marginTop:10,
          overflow:"hidden"
        }}
      >
        <div
          style={{
            width:`${percent}%`,
            height:"100%",
            background:color,
            transition:"1s"
          }}
        />
      </div>

    </div>
  );
}
